        font-size: 14px;
        padding: 2em 2em;
        width: 45%;

    }

    .logo {
        margin-left: 2em;
    }
    
    .info {
        font-size: 10px;
        padding-left: 2em;
        height: 15vh;

    }
}

@media screen and (max-width: 742px) {
    .glass {
        font-size: 14px;
        padding: 2em 2em;
        width: 100%;
        height: 40%;
        overflow: auto;
        top: auto;
        bottom: 0;
    }

    .logo {
        margin-left: 2em;
    }
    
    .info {
        font-size: 10px;
        padding-left: 2em;
        height: 15vh;
        bottom: 40%;

    }
}

@media screen and (max-width: 410px) {
    .glass {
        font-size: 12px;
        padding: 2em 2em;
        width: 100%;
        height: 40%;
        overflow: auto;
        top: auto;
        bottom: 0;
    }

    .logo {
        margin-left: 2em;
    }
    
    .info {
        font-size: 8px;
        padding-left: 2em;
        height: 12vh;
        bottom: 40%;

    }
}

