@use 'abstracts/' as *;
@use 'components/' as *;


*,
*::before,
*::after {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    scroll-behavior: smooth;
    font-family: 'Poppins', sans-serif;
}

html,body {
    font-size: 16px;
}
